import axios from 'axios';

function getData(config, callback, errorcallback){
    axios.get(url, config)
    .then(res => {
      if(callback != null){
         callback(res);
      }
    })
    .catch(err => {
      if(errorcallback != null){
         errorcallback(err);
         console.log(err, "check log");
      }
    })
}

export default getData;
